$(document).ready(function(){var n=io("http://localhost:7777");n.on("connection",function(n){console.log(n)}),n.on("tcp",function(n){$(".panel-tcp .cont-info").prepend("<p>"+n.datos+"</p>")}),n.on("packet",function(n){$(".panel-packets .cont-info").prepend("<p>"+n.datos+"</p>")}),n.on("ips",function(n){$(".panel-ips .cont-info").prepend("<p>"+n.datos+"</p>")}),n.on("raw",function(){}),n.on("disconnect",function(){console.log("Disconnect")}),n.on("error",function(){console.log("Error occured.")})});